import React from 'react';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Contact from './components/Contact';
import ParentComponent from './components/ParentComponent';
import Delete from './components/Delete';
import Update from './components/Update';
import CreateAccount from './components/CreateAccount';
import './Style.css';

function App() {
  return (
    <BrowserRouter>
      <ul>
        <li><Link className='Test' to="/">Accueil</Link></li>
        <li><Link className='Test' to="/about">Ã€ propos</Link></li>
        <li><Link className='Test' to="/contact">Contact</Link></li>
        <li><Link className='Test' to="/ParentComponent">Component</Link></li>
        <li><Link className='Test' to="/Delete">Delete</Link></li>
        <li><Link className='Test' to="/Update">Update</Link></li>
        <li><Link className='Test' to="/CreateAccount">CreateAccount</Link></li>
      </ul>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/ParentComponent" element={<ParentComponent />} />
        <Route path="/Delete" element={<Delete />} />
        <Route path="/Update" element={<Update />} />
        <Route path="/CreateAccount" element={<CreateAccount />} />
      </Routes>
    </BrowserRouter>

  );
}

export default App;
